import React from "react";
import Expenses from "./components/Expenses/Expenses";

function App() {
  const expenses = [
    {
      title: "Title",
      amount: 294.67,
      date: new Date(2021, 2, 18),
    },
    {
      title: "Car",
      amount: 294.67,
      date: new Date(2021, 2, 18),
    },
    {
      title: "Pet",
      amount: 294.67,
      date: new Date(2021, 2, 18),
    },
    {
      title: "Iso",
      amount: 294.67,
      date: new Date(2021, 2, 18),
    },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <Expenses items={expenses} />
    </div>
  );
}

export default App;
